def get_index(map_):
    k = 0
    num = 0
    for i in range(3):
        for j in range(3):
            num += (map_[j, i]+1)*(3**k)
            k += 1
    return num


def winner(map_):
    for i in range(0, 3):
        if map_[i, 0] == map_[i, 1] == map_[i, 2] != -1:
            return map_[i, 0]
        if map_[0, i] == map_[1, i] == map_[2, i] != -1:
            return map_[0, i]
    if map_[0, 0] == map_[1, 1] == map_[2, 2] != -1:
        return map_[0, 0]
    if map_[2, 0] == map_[1, 1] == map_[0, 2] != -1:
        return map_[i, 0]
    return -1


def is_leaf(map_):
    if winner(map_) != -1:
        return True
    for i in range(3):
        for j in range(3):
            if map_[i, j] == -1:
                return False
    return True


def simulation(MAP):
    while is_leaf(MAP) is False:
        Player = round(random.uniform(0, 1))
        if Player == 1:
            Max = -1
            best_i, best_j = -1, -1
            for i in range(3):
                for j in range(3):
                    if MAP[j, i] == -1:
                        MAP[j, i] = 1

                        if chances[get_index(MAP)] > Max:
                            best_i = i
                            best_j = j
                            Max = chances[get_index(MAP)]

                        MAP[j, i] = -1
            MAP[best_j, best_i] = 1
        else:
            Max = 1
            best_i, best_j = -1, -1
            for i in range(3):
                for j in range(3):
                    if MAP[j, i] == -1:
                        MAP[j, i] = 0

                        if chances[get_index(MAP)] < Max:
                            best_i = i
                            best_j = j
                            Max = chances[get_index(MAP)]

                        MAP[j, i] = -1
            MAP[best_j, best_i] = 0
    return winner(MAP)


